__NUXT_JSONP__("/works/nozopico", (function(a,b,c,d,e,f){return {data:[{work:{id:"nozopico",createdAt:e,updatedAt:f,publishedAt:e,revisedAt:f,title:"株式会社nozopico",category:[{id:"graphic",createdAt:a,updatedAt:a,publishedAt:a,revisedAt:a,name:"Graphic"},{id:"logo",createdAt:b,updatedAt:b,publishedAt:b,revisedAt:b,name:"Logo"}],release:"2019-04-30T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F1fdc287654164f9ba061b744b5cf0337\u002Fnozopico-thumb.png",height:c,width:d},overview:"ライバーサポート事務所「のぞプロ」などを運営している株式会社nozopico様のロゴと名刺を制作させていただきました。\n\n「pico=ピコッ」という語感をヒントに、多くの人々のきっかけになるスイッチをイメージ。\nビックリマークは、人のさまざまな感情を表しており、豊かで生き生きとした「生き方」と「働き方」を表現。\nまた右上へと駆け上がる形は、これから進む未来を示しています。\n\nロゴを使用する媒体によって、自由なバリエーションから選ぶことができます。",textlink1:"https:\u002F\u002Fnozopro.com\u002F",credit:"Art Direction \u002F Design: Hikari Kato",img1:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F6d8afbbd549c484397a58fbf14b79971\u002Fnozopico-logo_2.png",height:c,width:d},img2:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F4bd3b0fd90694793843a5c023db7372b\u002Fnozopico-namecard.jpg",height:c,width:d},img3:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F95fe594268db41bfb99c1c3f3d135819\u002Fnozopico-namecard_2-1.jpg",height:c,width:d}}}],fetch:{},mutations:void 0}}("2022-01-09T02:20:56.340Z","2022-01-09T02:19:08.407Z",860,1280,"2022-01-02T10:31:30.279Z","2022-01-10T01:46:41.490Z")));